import "./PlatformSidebar.scss";
import React from "react";

export class PlatformSidebar extends React.Component {
  renderUser() {
    return (
      <div className="user-snippet">
        <div
          className="user-snippet-photo"
          style={{ backgroundImage: `${this.props.user.avatar}` }}
        ></div>
        <div className="user-snippet-first-name">
          {this.props.user.first_name}
        </div>
        <div className="user-snippet-last-name">
        </div>
      </div>
    );
  }
  render() {
    return <div className="sidebar-department"></div>;
  }
}
